import React from 'react';
import 'antd/dist/antd.css';
import Input from'./input'
import { Table } from 'antd';

    export const columns = [
        {
          title: 'Name',
          dataIndex: 'name',
          width: 150,
        },
        {
          title: 'Age',
          dataIndex: 'age',
          width: 150,
        },
        {
          title: 'Address',
          dataIndex: 'address',
        },
      ];

const data = [];
for (let i = 0; i < 100; i++) {
  data.push({
    key: i,
    name: `Edward King ${i}`,
    age: 32,
    address: `London, Park Lane no. ${i}`,
  });
}

export default (props)=>
<div style={{padding:10,borderRadius:10}}>
<section><Input></Input></section>
<section><Table columns={columns} dataSource={data} pagination={{ pageSize: 30 }} scroll={{ y:400 }}/></section>

  
</div>
